Un missile antinavire est un missile destiné à attaquer et détruire un navire. Cette arme peut être tirée par : 
* Un aéronef (avion, hélicoptère ou drone), dans ce cas on parle d'un missile air-mer ; 
* Un navire de guerre, dans ce cas on parle d'un missile mer-mer ; 
* Une batterie fixe ou mobile basée à terre, dans ce cas on parle d'un missile sol-mer ; 
* Un sous-marin, il agit alors d'un missile à changement de milieu. En général, un même missile antinavire existe en deux ou trois versions, chacune correspondant à un des types indiqués ci-dessus. Par exemple, le missile Exocet français est disponible en versions AM39 (air-mer), MM38 (mer-mer) ou SM39 (lançable depuis un sous-marin en plongée), la version améliorée MM40 pouvant également être tirée depuis une batterie côtière.
